window.bookSummaryJSON = "<p>Hot on the heels of the <i>New York Times</i> best seller <i>William Shakespeare's Star Wars</i> comes the next two installments of the original trilogy: <i>William Shakespeare's The Empire Striketh Back</i> and <i>William Shakespeare's The Jedi Doth Return.</i> Return to the star-crossed galaxy far, far away as the brooding young hero, a power-mad emperor, and their jesting droids match wits, struggle for power, and soliloquize in elegant and impeccable iambic pentameter. These two plays offer essential listening for all ages. Something Wookiee this way comes! </p> <p>Read by Daniel Davis, Jonathan Davis, Ian Doescher, Jeff Gurner, January LaVoy, and Marc Thompson. </p>"; 
